import React from "react";
import Search from "./Search";
import Img from "./Img";
import Subtitle from "./Subtitle";
import Cards from "./Cards";
import { Link } from "react-router-dom";
import Warning from "./Warning";
import { IngData, ProData } from "./Database";

function Home() {
  return (
    <div className="page-container">
      <Img
        link={"https://picsum.photos/500/300"}
        alt={"EcoSunscreen-headimg"}
      />

      <Warning />
      <Subtitle text={"Ingredients"} />

      <Link to="/ingredients">
        <h3 className="more container">More Ingredients</h3>
      </Link>
      <Cards cardData={IngData} />
      <Subtitle text={"Products"} />

      <Link to="/products">
        <h3 className="more container">More Products</h3>
      </Link>
      <Cards cardData={ProData} />
    </div>
  );
}

export default Home;
